    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}Reservation index{% endblock %}

{% block body %}
    <h1>Reservation index</h1>

    <table class=\"table\">
        <thead>
            <tr>
                <th>ReservId</th>
                <th>NbPlaces</th>
                <th>DateAchat</th>
                <th>Total</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for reservation in reservations %}
            <tr>
                <td>{{ reservation.reservId }}</td>
                <td>{{ reservation.nbPlaces }}</td>
                <td>{{ reservation.dateAchat ? reservation.dateAchat|date('Y-m-d') : '' }}</td>
                <td>{{ reservation.total }}</td>
                <td>
                    <a href=\"{{ path('app_reservation_show', {'reservId': reservation.reservId}) }}\">Afficher</a>
                    <a href=\"{{ path('app_reservation_edit', {'reservId': reservation.reservId}) }}\">Modifier</a>
                    <a href=\"{{ path('app_reservation_delete', {'reservId': reservation.reservId}) }}\">Supprimer</a>

                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"5\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>
    <td><a href=\"{{ path('app_reservation_indexp') }}\"  class=\"btn btn-primary w-100 m-2\">Generer PDF</a> </td>

{% endblock %}
{% block form %}
{% endblock %}
{% block salesRevenue %}
{% endblock %}
{% block salesChart %}
{% endblock %}
{% block messages %}
{% endblock %}
{% block table %}
{% endblock %}", "reservation/index.html.twig", "C:\\Users\\21694\\Desktop\\quantech\\templates\\reservation\\index.html.twig");
